    const carUrl = getBase64Car();
    const lightUrl = getBase64Light();
    const cloudsUrl = getBase64Clouds();
    var showSplash = function () {
        // splash wrapper
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        // loading
        var loadDiv = document.createElement('div');
        loadDiv.id = 'loading';
        wrapper.appendChild(loadDiv);
        loadDiv.style.display = 'none';

        // æå¥é»è½¦
        var carDiv = document.createElement('div');
        carDiv.id = 'carboximg';
        loadDiv.appendChild(carDiv);
        var carImg = document.createElement('img');
        carImg.id = 'car';
        carImg.src =carUrl;
        carDiv.appendChild(carImg);
        carImg.onload = function () {
            loadDiv.style.display = 'block';
          
        };
        // æå¥è½¦ç¯
        var lightImg = document.createElement('img');
        lightImg.id = 'light';
        lightImg.src = lightUrl;
        carDiv.appendChild(lightImg);

        

        // æå¥äºé¾
        var cloudsDiv = document.createElement('div');
        cloudsDiv.id = 'clouds';
        loadDiv.appendChild(cloudsDiv);
        var cloudsBoxDiv = document.createElement('div');
        cloudsBoxDiv.id = 'cloudsbox';
        cloudsDiv.appendChild(cloudsBoxDiv);
        // é®å

        var cloudsImg = document.createElement('img');
        cloudsImg.src =cloudsUrl
        cloudsBoxDiv.appendChild(cloudsImg);


        // è¿åº¦
        var progress = document.createElement('div');
        progress.id = 'progress';
        loadDiv.appendChild(progress);

        var text = document.createElement('div');
        text.id = 'text';
        text.innerHTML = 'Loading, please wait'; 
        progress.appendChild(text);

        var bar = document.createElement('div');
        bar.id = 'bar';
        progress.appendChild(bar);

   

        var barfill = document.createElement('div');
        barfill.id = 'barfill';
        bar.appendChild(barfill);

    };

    var hideSplash = function () {
        var splash = document.getElementById('application-splash-wrapper');
        splash.parentElement.removeChild(splash);
    };

    var setProgress = function (value) {
        var bar = document.getElementById('barfill');
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            cloudProgress(value);
            bar.style.width = value * 100 + '%';
        
        }
    };
    // äºéæåº¦åå
    var cloudProgress = function (value) {
        let values =  Math.round(value * 100);
        let  cloudsDivS = document.getElementById("clouds");
        let  carlight = document.getElementById("light");
        let  cars = document.getElementById("car");
       
        if(values == 100){
            carlight.style.opacity = '1';
            cars.style.transform = 'scale(1.2, 1.2);';
        }else{
            cars.className = 'carboximg-scale'; 
            carlight.className = 'carboximg-scale'; 
        }
          cloudsDivS.style.opacity = value/2;
    };

